import React from "react";
//import swim from '../images/swim-pool.png'

const Card = (props) => {

    const {img, star, rating, reviewCount, country, title, price} = props;

     return (
         <div className='card'>
             <img src='../../images/swim-pool.png' className='card--image'/>
             <div className='card--stats'>
                 <img src={`../images/${star}`} className='card--star'/>
                 <span>{rating}</span>
                 <span>({reviewCount}) * </span>
                 <span>{country}</span>
             </div>
             <p>{title}</p>
             <p><span className='bold'>From ${price}</span> / person</p>
         </div>
     )
}

export default Card;
